import './App.scss';
import React from 'react';
import TitleName from './components/TitleName/TitleName';
// Counter
import {Listtitle,Listtitle2,Listtitle3} from './components/Counter/Listtitle/Listtitle';
import CounterList from './components/Counter/Counter_List/CounterList';
// TodoList
import styled, {createGlobalStyle} from 'styled-components';
import TodoTemplate from './components/TodoListA/TodoTemplate';

const GlobalStyle = createGlobalStyle`
  body {
    background-color: #425364
  }
`;


function App() {
  return (
    <div className="App">
      <TitleName name = "No.1" />
      <Listtitle name = "[이게 Props 니?]" color = "#ff0"/>
      <CounterList />
      <Listtitle2 />
      <Fragment>
        <GlobalStyle />
        <Container>
  	      <TodoTemplate />
        </Container>
      </Fragment>
      <Listtitle3 />
    </div>

  );
}

export default App;
